(3, 4, 'Envio do Trabalho Bimestral', '<p>Envie a análise do jogo.<br></p>', 1, 0, 0, 0, 0, 0, 1477446900, 0, 100, 1480284397, 0, 0, 0, 0, 0, 0, 0, 0, 'none', -1, 0, 0, 1, 0),
