INSERT INTO `mdl_course_sections` (`id`, `course`, `section`, `name`, `summary`, `summaryformat`, `sequence`, `visible`, `availability`) VALUES
(3, 4, 0, ' ', '<p><p style="text-align: center;"><strong>Sejam bem-vind@s a Disciplina de Computação Aplicada à Educação!</strong></p>\r\n<p style="text-align: center;"><strong>Esta disciplina é ofertada pelo Curso de Sistemas de Informação.</strong></p>\r\n<p style="text-align: center;"><strong>Ótimo semestre a tod@s!</strong></p><br></p>', 1, '8', 1, '{"op":"&","c":[],"showc":[]}'),
(13, 14, 0, NULL, '', 1, '1', 1, NULL),
(16, 17, 0, NULL, '', 1, '27', 1, NULL),
(18, 14, 1, NULL, '', 1, '', 1, NULL),
(19, 14, 2, NULL, '', 1, '39,40', 1, NULL),
(20, 14, 3, NULL, '', 1, '', 1, NULL),
(21, 14, 4, NULL, '', 1, '', 1, NULL),
(22, 14, 5, NULL, '', 1, '', 1, NULL),
(23, 14, 6, NULL, '', 1, '', 1, NULL),
(24, 14, 7, NULL, '', 1, '', 1, NULL),
(25, 14, 8, NULL, '', 1, '', 1, NULL),
(26, 14, 9, NULL, '', 1, '', 1, NULL),
