(28, 1, 0, NULL, '', 1, '2', 1, NULL),
(29, 1, 1, NULL, '', 1, '10', 1, NULL),
(50, 4, 1, '', '<p></p><div><div><div><div><h4 style="text-align: center;"><strong>Aula 1 - Apresentação da Disciplina</strong></h4>\r\n<p>Nesta aula iremos apresentar o plano da disciplina.</p></div></div></div></div><br><p></p>', 1, '9', 1, '{"op":"&","c":[],"showc":[]}'),
(51, 4, 2, '', '<p></p><div><div><div><div><h4 style="text-align: center;"><strong><span>Aula 2 - Fundamentos Educacionais</span></strong></h4>\r\n<p>Nesta aula iremos apresentar os conceitos básicos da disciplina e iremos realizar uma atividade!</p>\r\n<p>Boa aula!</p></div></div></div></div><br><p></p>', 1, '12', 1, '{"op":"&","c":[],"showc":[]}'),
(52, 4, 3, '', '<p><div><div><div><div><h4 style="text-align: center;">Aula 3 - Palestra</h4>\r\n<p>Nesta aula teremos a Palestra: "Eu, agente da mudança" (ministrada pelo Executivo do SEBRAE/RS André Blós).</p>\r\n<p>A palestra será realizada na Sala 20.&nbsp;</p>\r\n<p>Realize a atividade online desta aula!&nbsp;</p>\r\n<p>Boa palestra!</p></div></div></div></div><br></p>', 1, '13', 1, '{"op":"&","c":[],"showc":[]}'),
(53, 4, 4, '', '<p><div><div><div><div><h4 style="text-align: center;"><span><strong>Aula 4 - Ambientes Virtuais de Ensino-Aprendizagem</strong></span></h4>\r\n<p>Nesta aula iremos estudar os Ambientes Virtuais!</p>\r\n<p>Nossa aula será no Laboratório de Hardware!</p>\r\n<p>Boa aula!</p></div></div></div></div><br></p>', 1, '14,16', 1, '{"op":"&","c":[],"showc":[]}'),
(54, 4, 5, '', '<p><div><div><div><div><h4 style="text-align: center;"><span><strong>Aula 5 - Mapas Conceituais</strong></span></h4>\r\n<p><span><strong></strong></span>Nesta aula iremos estudar os Mapas Conceituais!</p>\r\n<p>Nossa aula será no Laboratório de Hardware!</p>\r\n<p>Boa aula!</p></div></div></div></div><br></p>', 1, '15,17', 1, '{"op":"&","c":[],"showc":[]}'),
(55, 4, 6, '', '<p><div><div><div><div><h4 style="text-align: center;"><strong>Aula 6 - Atividade Online</strong></h4>\r\n<p>Nesta aula desenvolva o trabalho bimestral, conforme apresentado na Aula 5.</p>\r\n<p>Não teremos aula presencial neste dia (13/09).</p>\r\n<p>As apresentações dos trabalhos serão nos dias 27/09 e 04/10.</p>\r\n<p>Bom trabalho!</p></div></div></div></div><br></p>', 1, '19', 1, '{"op":"&","c":[],"showc":[]}'),
(56, 4, 7, '', '<h4 style="text-align: center;"><b>Feriado!</b><br></h4>', 1, '', 1, '{"op":"&","c":[],"showc":[]}'),
(57, 4, 8, '', '<p><div><div><div><div><h4 style="text-align: center;"><strong>Aula 7 - Seminário de Apresentação de Trabalhos</strong></h4>\r\n<p>Nesta aula serão apresentados os Mapas Conceituais.</p></div></div></div></div><br></p>', 1, '', 1, '{"op":"&","c":[],"showc":[]}'),
(58, 4, 9, '', '<p><div><div><div><div><h4 style="text-align: center;"><strong>Aula 7 - Seminário de Apresentação de Trabalhos</strong></h4>\r\n<p>Nesta aula serão apresentados os Mapas Conceituais.</p></div></div></div></div><br></p>', 1, '', 1, '{"op":"&","c":[],"showc":[]}'),
(59, 4, 10, '', '<p><div><div><div><div><h4 style="text-align: center;"><strong>Aula 9 - Jogos Educativos Computadorizados</strong></h4>\r\n<p>Nesta aula iremos estudar o desenvolvimento de jogos educativos, sua \r\nestrutura, características e iremos estudar a análise dos jogos.</p>\r\n<p>Realize o trabalho na próxima aula!</p>\r\n<p>Não haverá aula presencial!</p></div></div></div></div><br></p>', 1, '20', 1, '{"op":"&","c":[],"showc":[]}'),
(60, 4, 11, '', '<p><div><div><div><div><h4 style="text-align: center;"><strong>IV JASI - Jornada Acadêmica de Sistemas de Informação</strong></h4>\r\n<p>Participem!</p></div></div></div></div><br></p>', 1, '', 1, '{"op":"&","c":[],"showc":[]}'),
(61, 4, 12, '', '<p><div><div><div><div><h4 style="text-align: center;"><strong>Aula 10 - Envio do Trabalho Bimestral</strong></h4>\r\n<p>Envie nesta aula a análise do jogo escolhido!</p>\r\n<p>Não haverá aula presencial!</p>\r\n<p>Bom trabalho!</p></div></div></div></div><br></p>', 1, '21,22', 1, '{"op":"&","c":[],"showc":[]}'),
(62, 4, 13, '', '<p><h4 style="text-align: center;"><strong>Aula 11 - Sistemas Especialistas</strong></h4>\r\n<p>Nesta aula iremos estudar os Sistemas Especialistas, sua estrutura e exemplos de aplicações.&nbsp;</p><br></p>', 1, '23,24,26,25', 1, '{"op":"&","c":[],"showc":[]}'),
(63, 4, 14, '', '<p><div><div><div><div><h4 style="text-align: center;"><strong>Aula 12 - EATI - &nbsp;Encontro Anual de Tecnologia da Informação</strong></h4>\r\n<p>Participem!</p></div></div></div></div><br></p>', 1, '', 1, '{"op":"&","c":[],"showc":[]}'),
(64, 4, 15, '', '<h4 style="text-align: center;"><b>Feriado!</b><br></h4>', 1, '', 1, '{"op":"&","c":[],"showc":[]}'),
(65, 4, 16, '', '<p><div><div><div><div><h4 style="text-align: center;"><strong>Aula 13 - Seminário de Apresentação de Trabalhos</strong></h4>\r\n<p>Nesta aula serão apresentados os Sistemas Especialistas.</p></div></div></div></div><br></p>', 1, '', 1, '{"op":"&","c":[],"showc":[]}'),
(66, 4, 17, '', '<p><div><div><div><div><h4 style="text-align: center;"><strong>Aula 14 - Projeto de Software Educativo</strong></h4>\r\n<p>Nesta aula serão apresentados os conceitos que envolvem o projeto de um software educativo.</p>\r\n<p>Boa aula!</p></div></div></div></div><br></p>', 1, '', 1, '{"op":"&","c":[],"showc":[]}'),
