(107, 'id_introeditor', 154, 'df5ad2e05f9b499d889fefc03bbbc40c862cc0a4', 2, '<p>Formulário com o objetivo de conhecer a percepção e opinião dos alunos e professores em relação ao ambiente Moodle proposto.<br>Utilizado como ferramenta para a validação do Trabalho de Graduação em Sistemas de Informação com o titulo:<br><b>Template para a Interface do AVA Moodle:&nbsp; um estudo de caso no curso de Sistemas de Informação da UFSM-Campus Frederico Westphalen</b><br>Cleomar João Theisen1, Guilherme Bernardino da Cunha2, Sidnei Renato Silveira2<br>Universidade Federal de Santa Maria – Campus Frederico Westphalen–RS<br>&nbsp;1Curso de Bacharelado em Sistemas de Informação<br>2Departamento de Tecnologia da Informação<br>cleomartheisen@hotmail.com, guilherme@ufsm.br, sidneirenato.silveira@gmail.com<br><br></p>', 722337229, 'yui_3_17_2_1_1480253316897_309', 1480253395),
