(120, 'id_summary_editor', 37, '5ffe421ae07e984710564ca8061aa54cb43520a5', 2, '<p><div><div><div><div><h4 style="text-align: center;"><strong><span>Aula 2 - Fundamentos Educacionais</span></strong></h4>\n<p>Nesta aula iremos apresentar os conceitos básicos da disciplina e iremos realizar uma atividade!</p>\n<p>Boa aula!</p></div></div></div></div><br></p>', NULL, 'yui_3_17_2_1_1480254980759_135', 1480255047),
(127, 'id_summary_editor', 37, '8835e23733f03f1a9cc33dba9b10d43aaad47762', 2, '', 945231895, 'yui_3_17_2_1_1480269475577_287', 1480269484),
(134, 'id_summary_editor', 37, '2b007bb333a4bd130bf700687b16af0b5f002eb5', 2, '<p><div><div><div><div><h4 style="text-align: center;"><span><strong>Aula 5 - Mapas Conceituais</strong></span></h4>\n<p><span><strong></strong></span>Nesta aula iremos estudar os Mapas Conceituais!</p>\n<p>Nossa aula será no Laboratório de Hardware!</p>\n<p>Boa aula!</p></div></div></div></div><br></p>', NULL, 'yui_3_17_2_1_1480272357465_135', 1480272467),
