(177, 'id_page_after_submit_editor', 154, '27d6fae5bb5a43e663ac4792b2497ab14d388aa4', 2, '<h4 style="text-align: center;">Obrigado pela contribuição !!<br></h4>', NULL, 'yui_3_17_2_1_1480334827110_577', 1480334897),
(190, 'id_message', 234, '525f39c0c8be71edd2f80a2974b9fa50d625063e', 2, '<p>Responder o Formulário o quanto antes possível!</p><p>Grato pela colaboração!!<br></p>', NULL, 'yui_3_17_2_1_1480337100685_302', 1480337173),
(203, 'id_introeditor', 227, 'e8c5f2d7a18e8f23a3e3584db361dd0fdd3c5984', 2, '<p style="text-align: center;">Formulário com o objetivo de conhecer a percepção e opinião dos alunos e professores em relação ao ambiente Moodle proposto.<br>Utilizado como ferramenta para a validação do Trabalho de Graduação em Sistemas de Informação:<br><br></p><h5 style="text-align: center;">Template para a Interface do AVA Moodle:&nbsp; um estudo de caso no curso de Sistemas de Informação da UFSM-Campus Frederico Westphalen</h5><p style="text-align: center;"><br>Cleomar João Theisen, Guilherme Bernardino da Cunha, Sidnei Renato Silveira</p><p style="text-align: center;">cleomartheisen@hotmail.com, guilherme@ufsm.br, sidneirenato.silveira@gmail.com</p><p><br></p>', 740614687, 'yui_3_17_2_1_1480367875762_308', 1480367946),
