(2, 1, 'Formulário de Validação da Reformulação Proposta', '<p>Formulário com o objetivo de conhecer a percepção e opinião dos alunos e professores em relação ao ambiente Moodle proposto.<br>Utilizado como ferramenta para a validação do Trabalho de Graduação em Sistemas de Informação com o titulo:<br><b>Template para a Interface do AVA Moodle:&nbsp; um estudo de caso no curso de Sistemas de Informação da UFSM-Campus Frederico Westphalen</b><br>Cleomar João Theisen1, Guilherme Bernardino da Cunha2, Sidnei Renato Silveira2<br>Universidade Federal de Santa Maria – Campus Frederico Westphalen–RS<br>&nbsp;1Curso de Bacharelado em Sistemas de Informação<br>2Departamento de Tecnologia da Informação<br>cleomartheisen@hotmail.com, guilherme@ufsm.br, sidneirenato.silveira@gmail.com<br><br></p>', 1, 1, 0, 1, 0, '', '<h4 style="text-align: center;">Obrigado pela contribuição !!<br></h4>', 1, 0, 0, 0, 1480337381, 0);
