(3, 2, 0, '1)	Como você considera a página inicial do ambiente onde estão listadas as disciplinas?', '', 'r>>>>>Excelente\r|Muito Bom\r|Bom\r|Regular\r|Insatisfatório', 'multichoice', 1, 2, 1, 0, '', 'h'),
(4, 2, 0, '2)	Ao abrir uma página de uma disciplina, como você considera a disposição dos elementos na tela?', '', 'r>>>>>Excelente\r|Muito Bom\r|Bom\r|Regular\r|Insatisfatório', 'multichoice', 1, 3, 1, 0, '', 'h'),
(5, 2, 0, '3)	Qual a sua opinião com relação à disposição dos blocos de informação?', '', 'r>>>>>Excelente\r|Muito Bom\r|Bom\r|Regular\r|Insatisfatório', 'multichoice', 1, 4, 1, 0, '', 'h'),
